import axios from "axios";

const getProducts = () => {
  return new Promise((onSuccess, onFail) => {
    axios
    .get("api/products")
    .then((response, error) => {
      if (!response || error) {
        return onFail(`Response failure : ${error}`);
        console.log(3)
      }
      onSuccess(response);
      console.log(response)
    });

  });

};

export default getProducts
